import Login from "./pages/Login";
import Orb from './Orb';

function App() {
  return (



    <div style={{ padding: 20 }}>
      <Orb
    hoverIntensity={0.5}
    rotateOnHover={true}
    hue={0}
    forceHoverState={false}
  />

      <h1>Forum API - Front</h1>
      <Login />
    </div>
  );
}

export default App;
